import React, { useState } from 'react'

export const Todo = () => {
    const [todo,setTodo]=useState('Buy apple');
    const [list,setList]= useState([]);
    const change=()=>{
     setList((olditem)=>{
      return [...olditem,todo];
     })
   list=[];
    }
    
    const show=(e)=>{
    setTodo(e.target.value)
    }
  return (
    <div className="main">
        <div className="card">
            <h1>TODO LIST</h1>
            <input type="text"
            onChange={show}
            />
            <button className='write'onClick={change}>+</button>
            <ol>
             {list.map((itemval)=>{
              return <li> {itemval}</li>
             })}
            </ol>
        </div>
    </div>
  )
}
